import { ADD_PRODUCT, REMOVE_PRODUCT } from "./actionType"

export const addProduct = (product) => ({
        type: ADD_PRODUCT,
        product
})

export const removeProduct = (product) => ({
        type: REMOVE_PRODUCT,
        product
})
